import React from "react";
import { BrowserRouter, Route, Switch } from "react-fontawesome";
import Header from "../elements/Header/Header";
import Home from "../Home/Home";

const App = () => {
  return (
    <BrowserRouter>
      <React.Fragment>
        <Header />
        <Home />
      </React.Fragment>
    </BrowserRouter>
  );
};

export default App;
